import React from 'react'

export default function RenewForm() {
  return (
    <div id='options'>
                    <h2>Renew the Pass</h2>

                    <form id="verification">
                        <label>User Id : <input type="file" required ></input></label>
                        <input className="btn" type="submit"></input>
                    </form>
                </div>
  )
}
